import React from "react";
import "./components/Toolbar.css";
import logo from "./res/logo.png"

function Toolbar() {
    return (
        <div className="Toolbar">
            <img src={ logo } />
            <a href="/">Home</a>
            <a href="/about">About Us</a>
            <a href="/projects">Projects</a>
            <a href="/login">Sign In</a>
        </div>
    );
}

export default Toolbar;
